We operate our business in four reportable segments, Agriculture, Construction, Europe (formerly known as "International"), and Australia, within which we engage in four principal business activities:
•new and used equipment sales;
•parts sales;
•equipment repair and maintenance services; and
•equipment rental and other activities. We offer our customers a one-stop solution by providing equipment and parts sales, equipment repair and maintenance services, and rental functions in each store. Our full service approach provides us with multiple points of customer contact and cross-selling opportunities. We believe our mix of principal business activities, as well as our broad geographic footprint, provide us with crop, weather and market diversification. This diversification helps to lower our overall exposure to adverse economic cycles that affect particular geographic markets or segments. We also believe our scale, customer service, centralized resources, and experienced management team provide us with a competitive advantage in many of our local markets.

Second, CNH Industrial supports our business by providing inventory financing, financial assistance and marketing support including the following:
•Floorplan payable financing for the purchase of a substantial portion of our equipment inventory;
•Retail financing used by many of our customers to purchase CNH Industrial equipment from us;
•Incentive, financing, and discount programs offered from time to time that enable us to price our products more competitively; and
•Promotional and marketing activities on national, regional and local levels.
Our financial performance is dependent on CNH Industrial's continued commitment to these offerings, at a level that allows us to be competitive in our markets. Third, CNH Industrial provides product warranties and, in some cases, extended warranties to our customers. Our stores perform warranty work for equipment under these product warranties, and we direct bill CNH Industrial as opposed to invoicing the customer. At any particular time, we have significant receivables from CNH Industrial for warranty work performed. CNH Industrial’s commitment to its product warranties is important to both our market share success and our warranty related parts and service revenue.

Risks Related to Economic Conditions Affecting our Customers' Demand for our Products and Services
Our agriculture equipment sales are significantly affected by net farm income, which is influenced by factors over which we have no control.
Farmers' capital expenditures often follow a cyclical pattern, with increased equipment purchases typically occurring during boom cycles spurred by high net farm income and strong farmer balance sheets. Net farm income is influenced by factors such as:
14
•the price of agricultural commodities and the ability to competitively export agricultural commodities;
•the cost of farm inputs including value of land, seed, fertilizer, fuel, labor and other inputs;
•the demand for food products and other products made with farm commodities such as biofuels;
▪the availability of stocks from previous harvests; and
•agricultural policies, including aid and subsidies to agricultural enterprises provided by governments, policies impacting commodity prices or limiting the export or import of commodities, and alternative fuel mandates. In addition to macroeconomic drivers of net farm income, local growing conditions also influence farmers’ buying sentiment. Therefore, droughts, excess rain, hail, and other unfavorable climatic conditions affecting certain geographic regions will adversely impact the local farmers’ buying sentiment.

Our operations in international markets subject us to risks and uncertainties arising from the differing legal, political, social and regulatory environments and economic conditions in the countries in which we operate. These risks include:
•difficulties in implementing our business model in foreign markets and operating our business across a significant number of different time zones;
•costs and diversion of domestic management attention related to oversight of international operations;
•unexpected adverse changes in export duties, currency or payment controls that impact our ability to repatriate funds from the country, quotas and tariffs and difficulties in obtaining import licenses;
•cyclicality of demand in European Union member states for agricultural equipment, based on availability of European Union government subsidy programs and tax incentives;
•unexpected adverse changes in foreign laws or regulatory requirements;
