•compliance with a variety of tax regulations, foreign laws and regulations; •compliance with the U.S. Foreign Corrupt Practices Act of 1977, as amended, and other U.S. laws that apply to the international operations of U.S. companies which may be difficult and costly to implement and monitor, can create competitive disadvantages if our competitors are not subject to such laws, and which, if violated, may result in substantial financial and reputational harm;

•increase our vulnerability to adverse economic and industry conditions;
•limit our flexibility in planning for, or reacting to, changes in our business and the industry in which we operate; and
•limit our ability to obtain additional financing for working capital, capital expenditures, acquisitions or general corporate purposes. We expect to use cash flow from operations and borrowings under our credit facilities to fund our operations, debt service and capital expenditures. However, our cash flow and ability to borrow depends on our future performance, which will be affected by financial, business, economic and other factors, many of which may be beyond our control.

The credit agreements governing our indebtedness restrict our ability to engage in certain corporate and financial transactions, and require us to satisfy financial covenants.
The credit agreements governing our indebtedness contain covenants that, among other things, may limit or place conditions on our ability to:
•incur more debt;
•make investments;
•create liens;
•merge, consolidate, or make certain acquisitions;
•transfer and sell assets, or divest of dealership stores;
•pay dividends or repurchase stock; and
•issue equity instruments.
