Any significant decline in the selling prices for used rental equipment, or increased costs resulting from our rental operations, could have an adverse effect on our results of operations and cash flows.
Tax Rates and New Tax Legislation - Changes in tax rates or the adoption of new tax legislation may affect our results of operations, cash flows and financial condition. The Company is subject to taxes in the U.S. and a number of foreign jurisdictions where it conducts business. The Company’s effective tax rate has been and may continue to be affected by changes in the mix of earnings in jurisdictions with differing statutory tax rates, changes in the valuation of deferred tax assets, and changes in tax laws or their interpretation, such as the 15% global minimum tax under the Organization for Economic Cooperation and Development ("OECD") Pillar Two, Global Anti-Base Erosion Rules. In addition, the U.S. government could adopt changes to international trade agreements, tariffs, taxes and other related regulations. If the Company’s effective tax rate were to increase, or if the ultimate determination of the Company’s taxes owed is for an amount in excess of amounts previously accrued, the Company’s results of operations, cash flows and financial condition could be adversely affected.

