•equipment rental and other activities. The new equipment and parts we sell are supplied primarily by CNH Industrial. According to its public reports, CNH Industrial is a leading manufacturer and supplier of agricultural and construction equipment based on the number of units sold, primarily through the Case IH Agriculture, New Holland Agriculture, Case Construction and New Holland Construction brands. Sales of new CNH Industrial products accounted for approximately 71% of our new equipment revenue in fiscal 2024, with our single largest manufacturer other than CNH Industrial representing approximately 3% of our total new equipment revenue in fiscal 2024. We acquire used equipment for resale primarily through trade-ins from our customers and in some cases through selective purchases. We sell parts and provide in-store and on-site repair and maintenance services. We rent equipment and provide other ancillary services such as equipment transportation, GPS signal subscriptions, farm data management systems, precision farming equipment, and finance and insurance products.

