Credit Market Changes Changes in credit markets can affect our customers' ability and willingness to make capital expenditures, including purchasing our equipment. Tight credit markets, a low level of liquidity in many financial markets, and extreme volatility in fixed income, credit, currency and equity markets have the potential to adversely affect our business. Such disruptions in the overall economy and financial markets and the related reduction in consumer confidence in the economy, slow activity in the capital markets, negatively affect access to credit on commercially acceptable terms, and may adversely impact our customers' access to credit and the terms of any such credit. However, if retail interest rates continue to rise, our business may be negatively affected by customers who find financing purchases of our equipment less attractive due to higher borrowing costs.

