Revenue Recognition Revenues are recognized when control of the promised goods or services is transferred to the customer, in an amount that reflects the consideration the Company expects to collect in exchange for those goods or services. Shipping and handling costs are recorded as cost of revenue. Sales, value added and other taxes collected from the Company's customers concurrent with the Company's revenue activities are excluded from revenue.
